import React from 'react'

class Route extends React.Component {
    state = {
        mainStore: "Colombo",
        routeCount: 15
    }
    render() {
        return (
            <div style={{ minHeight: "110px", backgroundColor: 'pink' }} className="m-5 p-3">
                <div className="row mb-3">
                    <div className="col-6 text-center fw-bolder"><span>{this.state.mainStore}</span></div>
                    <div className="col-6 text-center fw-bolder"><span>{this.state.routeCount}</span></div>
                </div>
                <div className="text-center fw-light" style={{ fontSize: "14px" }}>Show all routes in {this.state.mainStore}</div>
                <div className="text-center"><i class="fa fa-chevron-down"></i></div>

            </div>
        );
    }
}

export default Route;
